import React from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import { styled } from '@mui/material/styles';

const HeaderStyled = styled(AppBar)`
  background: #2874f0;

 
`;

const Header = () => {
  return (
    <>
    <HeaderStyled>
    <Toolbar>

    </Toolbar>
    </HeaderStyled>
    </>
  )
}

export default Header
